import React from "react";
import styled from "styled-components";

function Card(props){

    return(
        <Container>
            <p>
                {props.children}
            </p>
            <img href={props.image}/>
        </Container>
    )
}

export {Card};

const Container = styled.div`
border:2px solid FDC500;
`
